import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Auth0Provider } from "@auth0/auth0-react";
import { SendBirdProvider, withSendBird} from "sendbird-uikit";
import "sendbird-uikit/dist/index.css";
import { bpp as SendBirdApp } from "../node_modules/sendbird-uikit/dist/index";

ReactDOM.render(
  <Auth0Provider
    domain="dev-i3f-xl-9.us.auth0.com"
    clientId="OguJdqPBUScpGnwNgXgVL4J0yRYGuTDv"

  >
    <App />
    <div className="bpp">
            <SendBirdApp
                // Add the two lines below.
                appId='DA0FDF28-0F00-406D-BC4D-547CC61D1FD4'  // Specify your Sendbird application ID.
                userId='191148'   // Specify your user ID.
            />
    </div>
  </Auth0Provider>,

  document.getElementById('root')
);
